#wrapper{height: 250px; width: auto; overflow: hidden; position: relative; font-family: Arial; background: #ffffff;}

h2{height: 15px; line-height: 15px;}

ul.list li{position: relative; display: block; overflow: hidden; height: 42px; margin-top: 5px;
  background: #e5e5e5;}

ul li.first{margin-top: 0px;}

ul li span.num{position: absolute; width: 34px; line-height: 42px; height: 42px; text-align: center;
  color: #fff;
  background: rgba(0,0,0,0.6);
  border-right: 1px solid #ffffff;
  font-size: 18px; 
  font-family: SourceSansPro-Regular;
  text-shadow: 1px 1px 1px #000;
  }

ul.list li a{position: relative; display: block; overflow: hidden; line-height: 42px; height: 42px; word-wrap: break-word; padding: 0px 28px 0px 46px; background: url(http://contextual.media.net/__media__/pics/800015191/tran.png) right top no-repeat;
  color: #000000;
  font-size: 14px; 
  font-weight:normal;
  font-family: Arial;}

ul li span.arw{position: absolute; top: 50%; margin-top: -17px; right: 4px; width: 23px; line-height: 30px; height: 30px; font-size: 26px; text-align: center; font-family: Arial; font-weight: bold;
  color: #30384b;}

ul.list li:hover{background: rgba(0,0,0,0.7);}

ul li:hover span.num{border-right-color: #ffffff;
  color: #fff;
  background: rgba(0,0,0,0.7);}

ul.list li:hover a{color:#fff;}

ul.list li:hover span.arw{color: #ffffff;}
#footer{    position: absolute;
    overflow: hidden;
    top: 0px;
    height: 15px;
    width: 100%;
    }
a.footer{clear: both; position: absolute; top: 0px; right: 0px; width: 15px; height: 15px; line-height: 1px; font-size: 1px; margin-top: 0px; background: url(http://contextual.media.net/__media__/pics/800010042/footerbranding.png) right bottom no-repeat;}
a.footer:hover{width: 75px;}
